webpackJsonp([0x81639ca615d3],{1189:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/link-creating-a-snazzy-background-in-flex-4/index.md absPath of file >>> MarkdownRemark",html:'<p>Peter deHaan has posted a cool example of the way things work in the new Flex 4 \'Spark\' framework;</p>\n<p><a href="http://blog.flexexamples.com/2009/06/13/creating-a-fading-bitmap-fill-background-on-a-spark-panel-container-in-flex-4/">http://blog.flexexamples.com/2009/06/13/creating-a-fading-bitmap-fill-background-on-a-spark-panel-container-in-flex-4/</a></p>\n<p>The aim of the new Spark components is to make it much easier to customise the appearance of standard Flex components - similar to the <a href="http://www.degrafa.org/" target="_blank">Degrafa</a> project. If you\'re interested in either of these, then I hope you\'re already signed up for <a href="http://flashcamp.co.uk/" target="_blank">Flash Camp Birmingham</a>, June 16th 2009 (tomorrow), as <a href="http://jameswhittaker.com/" target="_blank">James Whittaker</a> of <a href="http://refreshingapps.com/" target="_blank">RefreshingApps.com</a> will be doing a session entitled <strong>"Skinning components with Degrafa &#x26; FXG"</strong> which should be interesting!</p>',frontmatter:{title:"Link: Creating a snazzy background in Flex 4",date:"June 15, 2009",tags:["flex","degrafa","flex-4","spark"]}}},pathContext:{}}}});
